import React from "react";

const SignUp = (props) => {
  return (
    <>
      <h2>회원가입</h2>
      <form className="form" action="index.html">
        <div className="input-div">
          <label>이메일</label>
          <br />
          <input
            id="email"
            type="email"
            placeholder="이메일 주소를 입력하세요."
          ></input>
          <Button type="submit" value="중복확인"></Button>
        </div>
      </form>
    </>
  );
};

export default SignUp;
